import React from "react";
import Home from "./Home";
import Heder from "./Heder";
import Filter from "./Filter";
import { BrowserRouter } from "react-router-dom/cjs/react-router-dom.min";

function Myroute(){
    return(
        <div>
            <BrowserRouter>
            <Heder/>
            <Home/>
            </BrowserRouter>
        </div>
    )
}

export default Myroute;
